webpackJsonp([0xc28f59823baf],{394:function(n,s){n.exports={data:{site:{siteMetadata:{title:"Nathan Birrell",author:"Nathan Birrell"}},markdownRemark:{id:"/Users/nathan/dev/nathanbirrell.github.io/src/pages/notes/typescript-key-types.md absPath of file >>> MarkdownRemark",html:'<p>Use bracket notation to define <em>key</em> types on Typescript interfaces. This is useful on key-driven data structures.</p>\n<p>For example, if we have an object of <code class="language-text">PositionError</code>s, where the key is our numeric error code and the value is an object with information about the error type.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code class="language-javascript"><span class="token keyword">interface</span> <span class="token class-name">IErrorType</span> <span class="token punctuation">{</span>\n  <span class="token punctuation">[</span>key<span class="token punctuation">:</span>number<span class="token punctuation">]</span><span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    code<span class="token punctuation">:</span> string<span class="token punctuation">,</span>\n    message<span class="token punctuation">:</span> string\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n\n<span class="token comment">// For example:</span>\n<span class="token keyword">export</span> <span class="token keyword">const</span> PositionError<span class="token punctuation">:</span>IErrorType <span class="token operator">=</span> <span class="token punctuation">{</span>\n  <span class="token number">1</span><span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    code<span class="token punctuation">:</span> <span class="token string">\'PERMISSION_DENIED\'</span><span class="token punctuation">,</span>\n    message<span class="token punctuation">:</span> <span class="token string">\'Please allow permission\'</span>\n  <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  <span class="token number">2</span><span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    code<span class="token punctuation">:</span> <span class="token string">\'POSITION_UNAVAILABLE\'</span><span class="token punctuation">,</span>\n    message<span class="token punctuation">:</span> <span class="token string">\'Something went wrong :(\'</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span></code></pre>\n      </div>',frontmatter:{title:"Define key types in Typescript interfaces",date:"April 20, 2018",hide:null}}},pathContext:{slug:"/notes/typescript-key-types/",previous:{fields:{slug:"/hello-world/"},frontmatter:{title:"Hello World"}},next:{fields:{slug:"/notes/enzyme-window-events/"},frontmatter:{title:"Test window-bound events on React components using Enzyme/Jest"}}}}}});
